  [],\n\t\"revision_timestamp\": \"2016-07-27T23:00:24.673321\",\n\t\"name\": \"ridgefield-himalayan-blackberry-removal-woodland-regeneration\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This project would expand the control,
  restoration, and monitoring efforts to replace stands of Himalayan blackberry and
  reed canarygrass with Oregon oak and Oregon ash woodlands at Ridgefield NWR pursuant
  to the RNWR Habitat Restoration Planting Plan 2009-2012 - Floodplain Riparian Forest
  and Oak Woodland (November 2009). The Refuge has developed a crew of volunteer herbicide
  applicators and volunteer planting teams to remove nonnative vegetation and establish
  stands of native vegetation with high wildlife value. Funds are requested for supplies
  (herbicide, fuel, tree tubes) and to hire a seasonal volunteer coordinator (October
  2010 though March 2011). Funds will be obligated in FY 2010. Work will take place
  from Aug. 1, 2010 u2013 March 30, 2011. In late summer 2010, herbicideapplicator
  crews will treat stands of Himalayan blackberry in the Refugeu2019s Carty and River
  S Units. The crews will use primarily backpack sprayers to avoid impacting non-target
  species. Following treatment, dead canes will be removed by YCC crews, volunteers,
  and Refuge staff. To prevent future blackberry encroachment, volunteers and Refuge
  staff will plant native trees and shrubs from local sources in treated areas. At
  least three volunteer planting events will be scheduled between November and March.
  The coordinator will also be responsible for working with volunteers to collect
  seeds and cuttings on Refuge and propagate plants for 2011-2012 restoration efforts.\",\n\t\"license_title\":
